Duo supports binary type operators with user-specified associativity and precedence. For example, the function type and the -> operator are specified in the following manner: -- | The function type
codata Fun : (-a : CBV, +b : CBV) -> CBN { Ap(a,return b)
}; type operator -> rightassoc at 0 := Fun; This first defines the codata type Fun and then introduces the arrow symbol as a custom notation for the Fun type with right associativity and precedence level 0. Every data and codata type has to be introduced with a lexical identifier, Fun in this example, before a type operator can be introduced for the type. The right-hand side of a type operator declaration expects the name of a typeconstructor with arity 2. Nullary and unary type operators are currently not implemented.

