Structural types, i.e. polymorphic variants and structural records, require their respective constructors and destructors to be declared at the toplevel before they can be used. This is different to, for example, OCaml, where a backtick in front of the name of the constructor is used. This design was chosen for the following reasons: Docstrings can be attached to the constructors at the declaration site, and these docstrings can be displayed on hover at the respective use sites. Typos in the names of constructors of polymorphic variants can be detected early. Since the evaluation of expressions in Duo is kind-directed, we need a place to specify how constructors and destructors of structural types are to be evaluated. Constructor declarations In order to define a structural variant of booleans, the following two declarations can be used. constructor True;
constructor False; In this case, no evaluation order has been specified, and in the case of constructors this defaults to CBV. I.e. the above declaration is a shorthand for the more explicit declaration: constructor True : CBV;
constructor False : CBV; For constructors which take arguments the user has to specify the evaluation order used for the respective argument position. Structural peano natural numbers where the argument to the successor constructor is evaluated eagerly are declared as follows: constructor Z;
constructor S(CBV); which, again, is shorthand for constructor Z : CBV;
constructor S(CBV) : CBV; These constructors then occur in structural data types like < True, False> or < S(< Z >)>. Destructor declarations Destructor declarations are similar to constructor declarations, with one difference. If you don't specify a evaluation order for the destructor, it defaults to CBN evaluation. Hence, the declaration destructor Name(CBV); is shorthand for the declaration destructor Name(CBV) : CBN; These destructors then occur in structural codata types like { Name(String) }.

