Duo has two different variants of nominal types; nominal data types and nominal codata types. Nominal Data Types Nominal data types are declared using the data keyword. For example, the following two declarations declare Booleans and Peano natural numbers, respectively. data Bool : CBV { True, False }; data Nat : CBV { Zero, Succ(Nat) }; Note that we have to indicate the evaluation order we want to use for that type. We can also use nominal data types to declare the unit and void type. data Unit : CBV { MkUnit };
data Void : CBV {}; When we declare parameterized data types, we have to declare both the kind of the type parameter, and its variance. For example, we can declare the type of lists of CBV types. data List : (+a : CBV) -> CBV { Nil, Cons(a, List(a))
}; In order for the algebraic subtyping approach to work, all type parameters have to be either covariant or contravariant. It currently isn't possible to use invariant type parameters, but such a feature might be added as syntactic sugar at a future point. Nominal Codata Types Codata types are introduced using the codata keyword. One of the standard examples of a codata type is the example of an infinite stream of natural numbers, called NatStream. A stream has two possible observations, Head and Tail, which we call the destructors of the codata type. The destructor Head returns the first element of the stream, and the destructor Tail returns the remainder of the stream. codata NatStream : CBN { Head(return Nat), Tail(return NatStream)
}; Codata types can also be parameterized, similar to the List example of the previous section. codata Stream : (+a : CBV) -> CBN { Head(return a), Tail(return Stream(a))
}; Codata types make it possible to define the function type, instead of having a builtin function type like most functional programming languages. The declaration of the function type looks like this. codata Fun : (-a : CBV, +b CBV) -> CBN { Ap(a, return b)
} Restriction on lattice types in arguments It is not possible to use lattice types in the arguments of constructors or destructors of data and codata types. For example, the following type is not allowed: data Foo : CBN { Bar(Top)
}; Without this restriction, lattice types will occur in positions in which they are not allowed. For the example above, Top occurs in a negative position in the typing rule for the constructor: Gamma |- e :prd tau tau <: Top
------------------------------------T-Ctor
Gamma |- Bar(e) :prd Foo but in a positive position in the typing rule for the destructor: Gamma, x : Top |- c :cmd
--------------------------------------- T-Match
Gamma |- case { Bar(x) => c } :cns Foo

