Structural refinement types are a novel idea in Duo which combine features from both nominal and structural types. They are declared similarly to nominal types, but use the additional keyword refinement in front of the declaration refinement data Bool : CBV { True, False };
refinement codata NatStream : CBN { Head(return Nat), Tail(return NatStream)
}; The syntax for refinement types is very similar to the syntax for structural data and codata types, but the refined type is indicated by a vertical pipe in front of the constructors/destructors. The four possible refinements of the boolean type, for example, are written like this: < Bool | True, False >
< Bool | True >
< Bool | False >
< Bool | > And a refinement of the codata type of NatStream is written like this: { NatStream | Head[Nat] }

