Duo is based on a term language for the sequent calculus. In distinction to lambda calculus, the term language of natural deduction, we have a first-class treatment of both producers and consumers of each type. In addition, there is a third syntactic category, commands. Commands are executable pieces of code. For example, it is possible to define producers, consumers and commands at the toplevel of the program: def prd someProducer := ...;
def cns someConsumer := ...;
def cmd someCommand := ...; Toplevel declarations of consumers and producers can additionally be annotated with a type scheme. def prd someProducer : ... := ...;
def cns someConsumer : ... := ...; For example, the polymorphic identity function is defined like so: def prd id : forall (a : CBV). a -> a := \x => x; If a function is used recursively in its own body, the rec keyword is necessary: def rec prd add := \x y => case x of { Z => y, S(x) => S(add x y)
} There are five categories of terms in Duo: Core constructs, which are independent of any concrete type. Producer introduction rules Consumer introduction rules Producer elimination rules Consumer elimination rules

